import React from 'react'
import '../styles/Thumbnail.css'

function Thumbnail (props){
    return(
        <ThemeContext.Consumer>
            <div className='thumbnail' >
                <h1>{props.title}</h1>
                <aside>{props.description}</aside>
            </div>
        </ThemeContext.Consumer>

    )
}

export default Thumbnail
